    '?client_id=' + this.props.clientId +
    '$redirect_uri=' + encodeURIComponent(this.props.redirectUri) +
    '&scope=' + encodeURIComponent(this.props.scope) +
    '&response_type=token' +
    '&states=' + encodeURIComponent(this.props.state);

    return <h1>Hell From Login</h1>
}

